import React from 'react';
import { BrowserRouter as Router, Link } from 'react-router-dom';

export default function Navbar() {
  return (
    <BrowserRouter>
      <div>
        <Link to='/'>Add todo</Link>
        <Link to='/todo'>Get Todo</Link>
      </div>
    </BrowserRouter>
  );
}
